const styles = {
    header: {
        height: '60px',
        backgroundColor: 'rgba(255,255,255,.3)',
        flexShrink: 0,
      },
      headerLogIn: {
        backgroundColor: 'red',
      },
      headerLogOut: {
        backgroundColor: 'blue',
      },
};

const Header = () => {
    return(
        <header className="App-header" css={styles.header}>
            <h1>header (eh oui)</h1>
        </header>
    )
}

export default Header
